import Layout from '../components/Layout';

class myApp extends App {
	render() {
		const { Component } = this.props;

		return (
      <Layout>
        <Component />
        <style jsx global>{`
          body {
            margin: 0;
            padding: 0;
          } 
        `}</style>
      </Layout>
		);
	}
}

export default myApp;
